package no.uib.info233.queue;/** * A class of runtime exceptions thrown by methods to indicate that a queue is * empty. *  * @author Frank M. Carrano * @author Timothy M. Henry * @version 4.2 */public class EmptyQueueException extends RuntimeException {    /**     *     */    private static final long serialVersionUID = 1L;    public EmptyQueueException() {        this(null);    }    public EmptyQueueException(String message) {        super(message);    }}